import Header from "./Header";
import "../asset/scss/main.scss";

const layoutStyle = {
  margin: 20,
  padding: 20,
  border: "1px solid #DDD",
};

const Layout = Page => (
  <div style={layoutStyle}>
    <Header />
    <Page />
  </div>
);


export default Layout;
